import React from "react";

const TestButton = ({ polling, setPolling, displayOrders }) => {
  // Functions
  const printOrders = () => {
    console.log(displayOrders);
    setPolling(!polling);
  };

  return (
    <React.Fragment>
      <button onClick={printOrders}></button>
    </React.Fragment>
  );
};

export default TestButton;
